import React, { useRef, useState } from 'react';
import axios from 'axios';
import './VideoEditor.css';

export default function VideoEditor() {
  const inputRef = useRef();
  const [file, setFile] = useState(null);
  const [preview, setPreview] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [mainTool, setMainTool] = useState('');  // 'bg', 'obj'
  const [subTool, setSubTool] = useState('');    // 'clip','crop','effect'
  const [clipRange, setClipRange] = useState({ start: 0, end: 5 });
  const [effect, setEffect] = useState('grayscale');

  const uploadFile = e => {
    const f = e.target.files[0];
    if (f && f.type.startsWith('video/')) {
      setFile(f);
      setPreview(URL.createObjectURL(f));
      setResult(null);
    }
  };

  const process = async () => {
    if (!file || (!mainTool && !subTool)) return alert('Choose tool then upload!');
    setLoading(true);
    const fd = new FormData();
    fd.append('video', file);
    const tool = mainTool || subTool;
    fd.append('tool', tool);
    if (tool === 'clip') {
      fd.append('start', clipRange.start);
      fd.append('end', clipRange.end);
    }
    if (tool === 'effect') fd.append('effect_type', effect);

    try {
      const res = await axios.post('http://localhost:8000/process', fd, {
        headers: { 'Content-Type': 'multipart/form-data' },
        responseType: 'blob',
      });
      setResult(URL.createObjectURL(new Blob([res.data], { type: 'video/mp4' })));
    } catch {
      alert('Oops, processing failed.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container">
      <aside className="sidebar">
        <div className="logo">ProGen AI</div>
        <button className={mainTool==='bg'?'active':''} onClick={() => {setMainTool('bg'); setSubTool('');}}>BG Removal</button>
        <button className={mainTool==='obj'?'active':''} onClick={() => {setMainTool('obj'); setSubTool('');}}>Object Removal</button>
        <button onClick={() => inputRef.current.click()}>Upload</button>
        <input ref={inputRef} type="file" accept="video/*" onChange={uploadFile} hidden/>
      </aside>
      <main className="main">
        {preview ? <video className="video" src={preview} controls /> : <div className="drop-area" onClick={() => inputRef.current.click()}>Click or Drop Video</div>}
        <div className="sub-tools">
          <button onClick={() => {setSubTool('clip'); setMainTool('');}}>Clip</button>
          <button onClick={() => {setSubTool('crop'); setMainTool('');}}>Crop</button>
          <button onClick={() => {setSubTool('effect'); setMainTool('');}}>Effects</button>
        </div>
        {subTool === 'clip' && (
          <div className="tool-options">
            <label>Start: <input type="number" value={clipRange.start} onChange={e => setClipRange({...clipRange, start:Number(e.target.value)})}/></label>
            <label>End: <input type="number" value={clipRange.end} onChange={e => setClipRange({...clipRange, end:Number(e.target.value)})}/></label>
          </div>
        )}
        {subTool === 'effect' && (
          <div className="tool-options">
            <label>
              Effect
              <select value={effect} onChange={e => setEffect(e.target.value)}>
                <option value="grayscale">Grayscale</option>
                <option value="invert">Invert</option>
                <option value="blur">Blur</option>
              </select>
            </label>
          </div>
        )}
        <div className="action-bar">
          <button onClick={process} disabled={loading}>
            {loading ? 'Working...' : mainTool || subTool ? 'Apply' : 'Choose Tool'}
          </button>
        </div>
        {result && (
          <div className="output">
            <h3>Result</h3>
            <video className="video" src={result} controls />
            <a href={result} download><button>Download</button></a>
          </div>
        )}
      </main>
    </div>
  );
}
